import './AboutUsStyles.css'
function AboutUs() {
    return (
        <div className='about-cnt'>
            <h1>Our History</h1>
            <p>Trippy is owned and managed by Trippy .In Pvt. Ltd, a leading brand in web designing services and e- solutions. which allows consumers to directly buy goods or services from a seller over the Internet using a web browser or a mobile app. Consumers find a product of interest by visiting the website of the retailer directly or by searching among alternative vendors using a shopping search engine.</p>

            <h1>Our Mission</h1>
            <p>Our mission is to touch the horizon where our capabilities may successfully meet with the requirements of our clients, that too with ultimate transparency and cost-effectiveness.</p>

            <h1>Our Vision</h1>
            <p>To saw the seeds of par-excellence services with customer centric approach and reap the trust of worldwide clients.</p>
        </div>
    )
}
export default AboutUs;
